    private static final Random RANDOM = new Random(8458243580324875285L);
    private static final List<String> FIRST_NAMES = List.of("Дмитрий", "Андрей", "Никита", "Илья", "Сергей","Владислав", "Даниил");
    private static final List<String> LAST_NAMES = List.of("Безбородов", "Гусев", "Захаров", "Кузнецов", "Лебедев", "Наумов", "Свиридов");
    private static final List<String> GROUPS = List.of("M3234", "M3235", "M3236", "M3237", "M3238", "M3239");

    private static final List<Student> STUDENTS = IntStream.range(0, 140)
            .mapToObj(id -> new Student(id, random(FIRST_NAMES), random(LAST_NAMES), random(GROUPS)))
            .collect(Collectors.toList());

    private static final List<List<Student>> INPUTS = IntStream.range(0, STUDENTS.size())
            .mapToObj(size -> {
                final List<Student> students = new ArrayList<>(STUDENTS);
                Collections.shuffle(students, RANDOM);
                return new ArrayList<>(students.subList(0, size));
            })
            .collect(Collectors.toList());


    private static <T> T random(final List<T> values) {
        return values.get(RANDOM.nextInt(values.size()));
    }

